byDate.map:
function (doc) {
  if (doc.activationId !== undefined) try {
    emit(doc.start, [doc._id, doc._rev]);
  } catch (e) {}
}

byDateWithLogs.map:
function (doc) {
  if (doc.activationId !== undefined && doc.logs && doc.logs.length > 0) try {
    var deleteLogs = true;
    for (i = 0; i < doc.annotations.length; i++) {
      var a = doc.annotations[i];
      if (a.key == "kind") {
        deleteLogs = a.value != "sequence";
        break;
      }
    }
    if (deleteLogs) {
      emit(doc.start, doc._id);
    }
  } catch (e) {}
}

activations.map:
function (doc) {
  var PATHSEP = "/";
  var isActivation = function (doc) { return (doc.activationId !== undefined) };
  var summarize = function (doc) {
    var endtime = doc.end !== 0 ? doc.end : undefined;
    return {
        namespace: doc.namespace,
        name: doc.name,
        version: doc.version,
        publish: doc.publish,
        annotations: doc.annotations,
        activationId: doc.activationId,
        start: doc.start,
        end: endtime,
        duration: endtime !== undefined ? endtime - doc.start : undefined,
        cause: doc.cause,
        statusCode: (endtime !== undefined && doc.response !== undefined && doc.response.statusCode !== undefined) ? doc.response.statusCode : undefined
      }
  };

  var pathFilter = function(doc) {
    var path = undefined;
    var binding = undefined;
    for (i = 0; i < doc.annotations.length; i++) {
      var a = doc.annotations[i];
      if (a.key == "path") {
        path = a.value;
      }
      if (a.key == "binding") {
        binding = a.value;
      }
    }
    try {
      if (binding) {
        var b = binding.split(PATHSEP)
        return b[1] + PATHSEP + doc.name;
      }
      if (path) {
        var p = path.split(PATHSEP);
        if (p.length == 3) {
          return p[1] + PATHSEP + doc.name;
        } else return doc.name;  
      }
    } catch (e) {
      return doc.name;
    }
    return doc.name;
  }

  if (isActivation(doc)) try {
    var value = summarize(doc)
    emit([doc.namespace+PATHSEP+pathFilter(doc), doc.start], value);
  } catch (e) {}
}

